import logo from './logo.svg';
import './App.css';
//import Nav from './Nav';
import {BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import VocabCard from './VocabCard';
import { VocabWords } from './Vocab';

function App() {
  return (
    <div>
      <Router>
        <div>
          <Switch>
            <Route path="/" exact component={Home}/>
          </Switch>
        </div>
      </Router>
      <header className="App-header">
        <div className="flexbox-row">
          {Object.values(VocabWords).map(vocabWord =>(
              <VocabCard kanji={vocabWord.kanji} characters={vocabWord.characters} romaji={vocabWord.romaji} part={vocabWord.part} meaning={vocabWord.meaning}/>
          ))}
        </div>
      </header>
    </div>
  );
}

const Home = () => (
  <div>
      <h1>Language Tracker</h1>
      <p>The purpose of this application is to aid 
          linguists and constructed language builders to be able to easily 
          record and reference sounds, words, grammer, and meaning.</p>
  </div>
)

export default App;
